import React from "react";
import Table from "../../commons/tables/table";


const columns = [
    {
        Header: 'Name',
        accessor: 'name',
        style: { 'whiteSpace': 'unset'}
    },
    {
        Header: 'Date',
        accessor: 'date',
        style: { 'whiteSpace': 'unset'}
    },
    {
        Header: 'Gender',
        accessor: 'gender',
        style: { 'whiteSpace': 'unset'}
    },
    {
        Header: 'Address',
        accessor: 'address',
        style: { 'whiteSpace': 'unset'}
    }
];

const filters = [
    {
        accessor: 'name',
    }
];

class CaregiverTable extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            tableData: this.props.tableData
        };
    }

    render() {
        return (
            <Table
                data={this.state.tableData}
                columns={columns}
                search={filters}
                pageSize={5}
            />
        )
    }
}

export default CaregiverTable;
